import React, { useState, useEffect } from 'react';
import axios from 'axios';
//import { useNavigate } from 'react-router-dom';
import './BookingHistoryPage.css';

const BookingHistoryPage = () => {
  const [bookingHistory, setBookingHistory] = useState([]);
  const [filteredBookings, setFilteredBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  //const navigate = useNavigate();

  const userId = localStorage.getItem('userId');

  const refreshBookingHistory = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get(`http://localhost:5000/routes/booking-history/${userId}`);
      if (response.data && response.data.length > 0) {
        setBookingHistory(response.data);
        setFilteredBookings(response.data); // set the filtered bookings initially as all bookings
      } else {
        setError('No bookings found for this user.');
      }
    } catch (err) {
      setError(err.response?.data?.message || err.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (userId) {
      refreshBookingHistory();
    } else {
      setError('User not logged in');
      setLoading(false);
    }
  }, [userId]);

  useEffect(() => {
    // Filter bookings based on the search term
    if (searchTerm) {
      const filtered = bookingHistory.filter((booking) =>
        booking.id.toString().includes(searchTerm) ||
        booking.location.toLowerCase().includes(searchTerm.toLowerCase()) ||
        booking.slot_id.toString().includes(searchTerm)
      );
      setFilteredBookings(filtered);
    } else {
      setFilteredBookings(bookingHistory); // reset to original list if no search term
    }
  }, [searchTerm, bookingHistory]);

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
  };

  if (loading) {
    return (
      <div className="booking-history-page">
        <h2>Your Booking History</h2>
        <div className="loading-container">
          {[...Array(3)].map((_, index) => (
            <div key={index} className="booking-card-skeleton">
              <div className="skeleton-line" style={{ width: '30%' }}></div>
              <div className="skeleton-line" style={{ width: '60%' }}></div>
              <div className="skeleton-line" style={{ width: '50%' }}></div>
              <div className="skeleton-line" style={{ width: '40%' }}></div>
            </div>
          ))}
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="error-container">
        <p className="error-message">Error: {error}</p>
        <button className="refresh-button" onClick={refreshBookingHistory}>
          Retry
        </button>
      </div>
    );
  }

  return (
    <div className="booking-history-page">
      <h2>Your Booking History</h2>
      <div className="search-refresh-container">
        <input
          type="text"
          className="search-input"
          placeholder="Search bookings..."
          value={searchTerm}
          onChange={handleSearchChange}
        />
        {/* <button className="refresh-button" onClick={refreshBookingHistory} disabled={loading}>
          {loading ? 'Refreshing...' : 'Refresh'}
        </button> */}
      </div>
      <div className="history-list">
        {filteredBookings.length > 0 ? (
          filteredBookings.map((booking, index) => (
            <div key={index} className="booking-card">
              <h3>Booking ID: {booking.id}</h3>
              <p><strong>Location:</strong> {booking.location}</p>
              <p><strong>Slot:</strong> {booking.slot_id}</p>
              <p><strong>Status:</strong> {booking.payment_status}</p>
              <p><strong>Reservation Time:</strong> {new Date(booking.reservation_time).toLocaleString()}</p>
            </div>
          ))
        ) : (
          <div className="no-bookings">
            <p>No bookings found.</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default BookingHistoryPage;
